INSERT INTO `cms_ctg_eshp_element` VALUES (1, 0, 31, 0, 'Автокресло детское универсальное с поворотным сиденьем "Kurutto high grade - red" от 2,5 до 18 кг, ', 'avtokreslo_detskoe_universalnoe_s_povorotnym_sidenem_kurutto_high_grade__red_ot_25_do_18_kg_', 1269786500, 0, 'Автокресло детское универсальное с поворотным сиденьем "Kurutto high grade - red" от 2,5 до 18 кг', '<p>Автокресло детское универсальное с поворотным сиденьем "Kurutto high grade - red" от 2,5 до 18 кг Безопасность кресла подтверждена результатами многочисленных краш-тестов независимой национальной экспертной компанией &laquo;NASVA&raquo; - Япония  Описание &bull; Анатомический вкладыш для новорожденного &ndash; тепло и влагоотводящий с эффектом &laquo;маминой руки&raquo;, формирует ровное комфортное ложе для младенца, идеально поддерживает тело ребёночка, равномерно распределяет нагрузку, оставляя при этом абсолютно расслабленными все суставы! &bull; "Чаша" кресла очень просто поворачивается в любую сторону на 360 градусов, что позволяет легко укладывать (усаживать) малыша в кресло! Теперь нет необходимости в зависимости от возраста ребёнка перезакреплять кресло по ходу, или против хода движения авто. Просто нажмите на клавишу и поверните чашу!!! И на всё это несколько секунд!!! Ну а рядом сидящим пассажирам, пребывая в этих многочисленных и утомляющих "автопробках", кресло позволит, не поднимаясь с сидения контролировать ребёночка или поиграть с ним, предоставляя в дороге ему и себе максимум КОМФОРТА! Всё для вашего удобства! Не важно, какой стороной к тротуару припаркован Ваш автомобиль. Конструкция кресла обеспечивает возможность его крепления с любой стороны авто! &bull; Дополнительный упор кресла в пол выполнен не в форме трубки, а имеет П-образную форму, обеспечивая тем самым большую площадь опоры, и максимально предотвращает опрокидывание кресла. &bull; Подставка для ног не является дополнительной опцией и предусмотрена конструкцией кресла. Она используется для самостоятельно сидящего ребёнка, придаёт ему уверенность, обеспечивает удобное положение. &bull; Для обеспечения максимального комфорта ребёночку в дороге, под тканевую обивку внутри кресла помещёна подушка "Ultra Cushion" из специального виброгасящего материала. &bull; Регулируемый 3 уровневый наклон - регулировки легкодоступны, выполняются плавно, в том числе и с сидящим в кресле малышом. &bull; Удерживающие пятиточечные ремни - снабжены мягкими и широкими защитными накладками, регулируются по росту и комплекции малыша. &bull; Система быстрого натяжения ремней &ndash; точная подгонка ремней одним движением. &bull; Замок ремней - легко закрывается и открывается родителями, но сам малыш случайно его расстегнуть не сможет. &bull; Глубокая и комфортная посадка, высокие боковины - является элементом пассивной безопасности, удерживают ребенка на поворотах и защищают при боковом ударе. &bull; Эргономичная форма сиденья - усиленная, довольно жесткая спинка с изгибами, учитывающими анатомические особенности строения тела малыша. &bull; Система вентиляционных отверстий в спинке кресла, мягкая воздухопроницаемая обивка &ndash; малышу не жарко, его спина не потеет. Обивка легко снимается и стирается. &bull; Способ крепления &ndash; штатные ремни безопасности. &bull; Великолепное качество пластика не повредит сидение Вашего Авто, даже если оно покрыто нежнейшей кожей! К каждому автокреслу в комплекте DVD &ndash; диск с правилами установки и применения на русском языке! Вес малыша - от 2,5 до 18 кг. Рост малыша - от 50 до 100 см. Возрастная категория &ndash; от рождения до 3-4 лет. Curutto - сделано в Японии!</p>', '', 10, 20500.00, 0.00, 0.00, 0.00, 1, 1, 'Детские автокресла AILEBEBE - KURUTTO в Казани', 'детские, автокресла, курутто, казань, интернет-магазин, купить', 'Продажа детских автокресел KURUTTO в Казани', 1, 0, 0);
