INSERT INTO `cms_ctg_eshp_element` VALUES (6, 0, 39, 0, 'Цыпленок веселый, ', 'cyplenok_veselyj_', 1269860357, 0, 'Цыпленок веселый', '<h3>Из чего сделаны игрушки "LANCO"</h3>\n<p>Игрушки "LANCO" изготовлены из <strong>натурального латекса</strong>.</p>\n<p>ЛАТЕКС (от лат. latex -жидкость, сок) - экологически чистый, натуральный материал, получаемый из сока каучукового дерева - гевеи.</p>\n<h3>Безопасность игрушек</h3>\n<p>Латексные игрушки"LANCO" не вызывают аллергии.</p>\n<p>Они абсолютно безопасны, их невозможно прокусить, порвать, сломать, при этом они привлекают яркостью красок и мягкостью форм.</p>\n<p>Все латексные игрушки "LANCO" раскрашиваются вручную с использованием пищевых красителей.</p>\n<p>Игрушки "LANCO" озвучены пищалкой. Уровень звука латексных игрушек соответствует стандарту уровня звука для игрушек, издающих импульсивный звук в качестве игрового момента, и не нанесет вреда нежному слуху ребенка.</p>\n<h3>Качество и гарантии</h3>\n<p>Игрушки "LANCO" производятся в Испании и соответствуют всем Европейским стандартам качества и нормам безопасности.</p>\n<p>Высокое качество и безопасность латексных игрушек "LANCO" подтверждены санитарно-эпидемиологическим заключением, сертификатом соответствия, сертификатом происхождения, гарантийным письмом о безвредности используемых красителей.</p>\n<h3>Как мыть латексные игрушки "LANCO"?</h3>\n<p>Латексные игрушки можно мыть в холодной или теплой воде с нейтральным мылом.</p>\n<h3>Опасайтесь некачественных подделок!</h3>\n<p>Настоящие игрушки имеют маркировку LANCO (у некоторых она расположена на пищалке) и маркировку СЕ. Только игрушки "LANCO" производятся в Испании из 100% натурального латекса без минеральных добавок!</p>', '', 3, 158.00, 0.00, 0.00, 0.00, 2, 2, 'Латексные игрушки для малышей LANCO в Казани', 'латексные игрушки, ланко, LANCO, казань, для детей, для малышей, продажа игрушек', 'Продажа детских игрушек из натурального латекса LANCO в Казани.', 0, 0, 0);
